Новое приложение «Мобильный банк "Центр-инвест"» позволяет получить оперативную информацию по картам, счетам, депозитным и кредитным договорам, оплачивать услуги связи, интернета и телевидения, осуществлять переводы. Приложение поддерживает оплату по QR, имеет модуль чата с банком и финансовой аналитики. C помощью приложения можно найти ближайший банкомат банка "Центр-инвест", посмотреть информацию о курсах валют.
Внимание! Использование приложения может быть ограничено настройками учетной записи сервиса «Мобильный банк».



Текущие возможности приложения:
- контроль операций и остатка по своим картам банка «Центр-инвест»;
- оплата услуг, переводы на любые карты;
- получение информации по кредитам и вкладам;
- погашение кредитов и пополнение вкладов;
- чат с сотрудником банка;
- аналитика финансов;
- поиск ближайших банкоматов;
- управление услугами Ваших продуктов, курсы валют и другие информационные сервисы.



Мы непрерывно работаем над улучшением нашего приложения. Если Вы столкнулись со сложностью или у Вас появилась интересная идея, напишите нам в чат приложения или свяжитесь с нами по электронной почте link@centrinvest.ru.
